// import  'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import HeaderApp from "./AppHTML/HeaderApp";

function App() {
  return (
    <div className="container">
      <HeaderApp />
      <NavApp />
      <MainApp />
      <FooterApp />
    </div>
  );
}





function MainApp() {
  return (
    <main className="MainApp">
      MainApp
    </main>
  );
}

function FooterApp() {
  return (
    <footer className="footerApp">
      FooterApp
    </footer>
  );
}

export default App;
